(4581, 'Semangat gotong royong juga disampaikan oleh Dr. Carina Joe sebagai salah satu peneliti vaksin AstraZeneca, bhw vaksin AZ harus merata dan tdk mengutip keuntungan sama sekali.\n#BPIP #BangkitBersama #GotongRoyong\n @BPIPRI https://t.co/20pBC01LuJ', 'Astrazeneca', '2022-08-24'),
