(4583, 'Hadir juga di seminar @BPIPRI mba Carina mewakili anak muda Indonesia yang bergabung sebagai peneliti vaksin vaksin astrazeneca #BangkitBersama #GotongRoyong #BPIP', 'Astrazeneca', '2022-08-24'),
(4584, 'Dr. Carina Joe, peneliti vaksin AstraZeneca asal Indonesia, mengakui meskipun tinggal di luar negri, ia sudah mengenal dan mengaplikasikan nilai2 Pancasila sejak dini. Ini menunjukkan bahwa aplikasi Pancasila bisa dilakukan di mana saja\n@BPIPRI\n#BPIP #BangkitBersama #GotongRoyong', 'Astrazeneca', '2022-08-24'),
(4586, 'Seperti Kak Carina sudah ditanamkan dari kecil nilai2 Pancasila salah satunya gotong royong atau berkerjasama. Akhirnya dia dapat menyelesaikan dalam menemukan vaksin Astrazeneca \n\n #BPIP #BangkitBersama #GotongRoyong\n@BPIPRI', 'Astrazeneca', '2022-08-24'),
(4589, 'Keren ini dr.Carina Joe peneliti vaksin Astrazeneca, ttp menerapkan nilai2 Pancasila walo tinggal di luar negeri #BPIP #BangkitBersama #GotongRoyong \n@BPIPRI', 'Astrazeneca', '2022-08-24'),
(4591, 'Keren sekali narasumber seminar kali ini bahkan ada Dr Carina Joe WNI yang bermukim di Amerika  peneliti vaksin AstraZeneca \n\n#BPIP #BangkitBersama #GotongRoyong \n@BPIPRI', 'Astrazeneca', '2022-08-24'),
(4592, 'Nilai2 Pancasila sudah diterapkan kehidupan sehari-hari seperti Kak Carina yang saat ini lagi di Amerika Serikat. Dari kecil sudah ditanamkan nilai2 Pancasila dan terbukti pas pandemi dia penemu vaksin Astrazeneca #BPIP #BangkitBersama #GotongRoyong @BPIPRI', 'Astrazeneca', '2022-08-24'),
